import React from 'react';
import { useAuth } from '../context/AuthContext';

const AuthTest = () => {
  const { user, token, isAuthenticated, loading, error } = useAuth();

  return (
    <div className="min-h-screen bg-gray-50 p-8">
      <div className="max-w-4xl mx-auto">
        <h1 className="text-3xl font-bold text-gray-900 mb-8">Authentication Test</h1>
        
        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
          {/* Status Card */}
          <div className="bg-white rounded-lg shadow p-6">
            <h2 className="text-xl font-semibold mb-4">Authentication Status</h2>
            <div className="space-y-2">
              <div className="flex justify-between">
                <span className="font-medium">Loading:</span>
                <span className={loading ? 'text-yellow-600' : 'text-green-600'}>
                  {loading ? 'Yes' : 'No'}
                </span>
              </div>
              <div className="flex justify-between">
                <span className="font-medium">Authenticated:</span>
                <span className={isAuthenticated ? 'text-green-600' : 'text-red-600'}>
                  {isAuthenticated ? 'Yes' : 'No'}
                </span>
              </div>
              <div className="flex justify-between">
                <span className="font-medium">Has Token:</span>
                <span className={token ? 'text-green-600' : 'text-red-600'}>
                  {token ? 'Yes' : 'No'}
                </span>
              </div>
              <div className="flex justify-between">
                <span className="font-medium">Has User:</span>
                <span className={user ? 'text-green-600' : 'text-red-600'}>
                  {user ? 'Yes' : 'No'}
                </span>
              </div>
            </div>
          </div>

          {/* Token Card */}
          <div className="bg-white rounded-lg shadow p-6">
            <h2 className="text-xl font-semibold mb-4">Token Information</h2>
            {token ? (
              <div className="space-y-2">
                <div className="text-sm text-gray-600">
                  <strong>Token:</strong> {token.substring(0, 20)}...
                </div>
                <div className="text-sm text-gray-600">
                  <strong>Length:</strong> {token.length} characters
                </div>
              </div>
            ) : (
              <div className="text-red-600">No token found</div>
            )}
          </div>

          {/* User Card */}
          <div className="bg-white rounded-lg shadow p-6">
            <h2 className="text-xl font-semibold mb-4">User Information</h2>
            {user ? (
              <div className="space-y-2">
                <div className="text-sm text-gray-600">
                  <strong>Name:</strong> {user.name}
                </div>
                <div className="text-sm text-gray-600">
                  <strong>Email:</strong> {user.email}
                </div>
                <div className="text-sm text-gray-600">
                  <strong>Role:</strong> {user.role}
                </div>
                <div className="text-sm text-gray-600">
                  <strong>ID:</strong> {user.id}
                </div>
              </div>
            ) : (
              <div className="text-red-600">No user data</div>
            )}
          </div>

          {/* Error Card */}
          <div className="bg-white rounded-lg shadow p-6">
            <h2 className="text-xl font-semibold mb-4">Error Information</h2>
            {error ? (
              <div className="text-red-600">{error}</div>
            ) : (
              <div className="text-green-600">No errors</div>
            )}
          </div>
        </div>

        {/* Actions */}
        <div className="mt-8 bg-white rounded-lg shadow p-6">
          <h2 className="text-xl font-semibold mb-4">Actions</h2>
          <div className="space-x-4">
            <button
              onClick={() => window.location.reload()}
              className="bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700"
            >
              Refresh Page
            </button>
            <button
              onClick={() => {
                localStorage.removeItem('token');
                window.location.reload();
              }}
              className="bg-red-600 text-white px-4 py-2 rounded hover:bg-red-700"
            >
              Clear Token & Refresh
            </button>
            <button
              onClick={() => window.location.href = '/login'}
              className="bg-green-600 text-white px-4 py-2 rounded hover:bg-green-700"
            >
              Go to Login
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AuthTest;
